/**
 * @param args
 */
public static void main(String[] args) {
  double lat1 = 0;
  double long1 = 0;
  double lat2 = 0;
  double long2 = 0;

  for (int i =0; i < 90; i++){
    double dis = DistanceUtils.getInstance().getDistanceMi(lat1, long1, lat2, long2);
    lat1 +=1;
    lat2 = lat1 + 0.001;

    System.out.println(lat1+","+long1+","+lat2+","+long2+","+formatDistance(dis));

  }

}

